import Layout from '../components/layout'

function HomePage() {
  return (
    <Layout>
      <h1>Welcome to Next.js!</h1>

    </Layout>
  )
}
export async function getStaticProps(context) {
  return {
    props: {}, // will be passed to the page component as props
  }
}
export default HomePage
